import React from 'react'

export default function List_View() {
    const data =
        ['Use Array.map',
            'Not a for loop',
            'Give each item a unique key',
            'Avoid using array index as the key']
    const listItems = data.map((value) =>
        <li>{value}</li>
    );
    return (
        <ul>{listItems}</ul>
    )
}
